import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for any "Your Profile" link using a unique XPath (to avoid previous selector failures)
    // We'll look for the *last* "Your Profile" link, assuming Jun's Profile is at the bottom
    const profileLinks = await page.$x("//a[normalize-space(text())='Your Profile']");
    if (profileLinks.length === 0) {
      throw new Error('No "Your Profile" link found');
    }
    const targetProfileLink = profileLinks[profileLinks.length - 1];

    // Scroll into view and click the link
    await targetProfileLink.scrollIntoViewIfNeeded();
    await targetProfileLink.click();

    // Wait for the profile page to load (look for Jun's profile image by alt attribute)
    await page.waitForSelector("img[alt='Jun Kim']", { timeout: 5000 });

    // Take screenshot after navigation
    const profileShot = path.join(screenshotsDir, 'step_2_jun_profile.png');
    await page.screenshot({ path: profileShot });
    screenshots.push(profileShot);

    // Extract Jun's profile full name and username for verification
    const fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.profile-info .username', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile details",
      extractedData: {
        fullName,
        username
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
